webpackJsonp([0x615bdcb74036],{5380:function(t,e){t.exports={data:{post:{html:'<p>Sometimes it pays to watch the nature shows on TV. In ARD is a film about a bird called <i>Eistaucher</i>, "ice diver"? Never heard of it, so I thought, but it turns out to be the <a href="http://www.khayward.com/loon.html">Common Loon</a> <i>Gavia immer</i>, filmed in northern Minnesota. I thought I recognized that sound. </p>\n<p>I\'m still here. Mama\'s out of town until Saturday, so I have both early and late shifts with Christopher, and time is short. How do single parents manage day in and day out? And we\'re in the middle of a particularly despressing cold and rainy spell.</p>\n<p>I did get my Perl programming problem sorted out yesterday, though.</p>',fields:{title:"Cold rain",date:"08 Nov 2001",url:"https://papascott.de/2001-11-08-cold-rain/"}}},pathContext:{slug:"/2001-11-08-cold-rain/",prev:{fields:{title:"Bark bark",date:"06 Nov 2001",slug:"/2001-11-06-bark-bark/"}},next:{fields:{title:"Dump On Me",date:"10 Nov 2001",slug:"/2001-11-10-dump-on-me/"}}}}}});
